class Cartlistmodel {
  Cartlistmodel({
    int? status,
    dynamic error,
    Messages? messages,
    String? imageBaseUrl,
    String? companyImageBaseUrl,
    List<CartList>? cartList,
  }) {
    _status = status;
    _error = error;
    _messages = messages;
    _imageBaseUrl = imageBaseUrl;
    _companyImageBaseUrl = companyImageBaseUrl;
    _cartList = cartList;
  }

  Cartlistmodel.fromJson(dynamic json) {
    _status = json['status'];
    _error = json['error'];
    _messages =
        json['messages'] != null ? Messages.fromJson(json['messages']) : null;
    _imageBaseUrl = json['image_base_url'];
    _companyImageBaseUrl = json['company_image_base_url'];
    if (json['cart_list'] != null) {
      _cartList = [];
      json['cart_list'].forEach((v) {
        _cartList?.add(CartList.fromJson(v));
      });
    }
  }
  int? _status;
  dynamic _error;
  Messages? _messages;
  String? _imageBaseUrl;
  String? _companyImageBaseUrl;
  List<CartList>? _cartList;
  Cartlistmodel copyWith({
    int? status,
    dynamic error,
    Messages? messages,
    String? imageBaseUrl,
    String? companyImageBaseUrl,
    List<CartList>? cartList,
  }) =>
      Cartlistmodel(
        status: status ?? _status,
        error: error ?? _error,
        messages: messages ?? _messages,
        imageBaseUrl: imageBaseUrl ?? _imageBaseUrl,
        companyImageBaseUrl: companyImageBaseUrl ?? _companyImageBaseUrl,
        cartList: cartList ?? _cartList,
      );
  int? get status => _status;
  dynamic get error => _error;
  Messages? get messages => _messages;
  String? get imageBaseUrl => _imageBaseUrl;
  String? get companyImageBaseUrl => _companyImageBaseUrl;
  List<CartList>? get cartList => _cartList;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['status'] = _status;
    map['error'] = _error;
    if (_messages != null) {
      map['messages'] = _messages?.toJson();
    }
    map['image_base_url'] = _imageBaseUrl;
    map['company_image_base_url'] = _companyImageBaseUrl;
    if (_cartList != null) {
      map['cart_list'] = _cartList?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

